import React, { Component } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow } from "mdbreact";
import "./index.css";
import logo from "./logo.png";
import Navbar from "./components/Navbar";

class App extends Component {
  render() {
    return (
      <MDBContainer>
        <Navbar />
        <div className="content" />
      </MDBContainer>
    );
  }
}

export default App;
